import React from "react";
import { Table } from "@mui/material";
import axios from "axios";
import { useState } from "react";
import getNonAdminTable from "./getNonAdminTable";

const getAdmin = (props) => {
    const [userData, setUserData] = useState({});
    const [loading, setLoading] = useState(false);
    const [columns, setColumns] = useState([]);
    const [dataa, setDataList] = useState([]);
    const [refresh, setRefresh] = useState(false);
    const [odabraniUser, setOdabraniUser] = useState(null);

    const handleUser = (user) => {
        setOdabraniUser(user);
    };


    React.useEffect(() => {
        const getData = async () => {
            let dataa = (
                await axios.get('http://localhost:5000/session')
            ).data;
            //setValue(data[0]);
            setDataList(dataa);
        };
        getData().catch((err) => console.log(err));
    }, [refresh]);


    return (
        <div>
            <getNonAdminTable handleUser={handleUser}/>
        </div>
    );
};

export default getAdmin;
